import './App.css';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";
import Navbar from './components/Navbar';
import Home from './components/Home';

function App() {
  return (
    <>

      <Router>
        <Navbar />
        <Home />

        {/* react router dom */}
        <Routes>
          <Route path="/about" element={<About /> }/>
          <Route path="/" element={<Home />} />
        </Routes>
      </Router>
      </>
      );
}

export default App;
